import { createApp }  from 'vue'
import Vuex from 'vuex'
import App from "@/App";

const app = createApp(App);
app.use(Vuex);

let store = new Vuex.Store({
    state: {
        products: []
    },
    mutations:{},
    actions: {},
    getters: {}
});

export default store;
